const PageHeader: FC = () => {

  return (
    <AppBar sx={{ flexDirection: 'row', justifyContent: 'space-between' }}>
      {/* Import github and linkedin logos and make them links/button */}
      <Box>
        insert logo/github/linkedin profiles
      </Box>
      <Box sx={{
        fontFamily: 'Arial',
      }}>
        {/* middle = logo */}

        <img src={ nameCard } width='10%'/>
      </Box>
      <Box>
        <Typography>settings menu OPTIONAL!</Typography>
      </Box>
    </AppBar>
  )
}

export default PageHeader;
